class ResPartner {
  constructor(ids) {
    this._ids = [];
    this._id = null;

    if (ids && typeof ids === 'object') {
      this._ids = ids;
      this._id = ids.length ? ids[0] : null;
    } else {
      this._id = ids;
      this._ids = ids ? [ids] : [];
    }
  }

  get length() {
    return this._ids.length;
  }

  get ids() {
    return this._ids;
  }

  get id() {
    return this._id;
  }

  look2(fields) {
    return this._ids.map(id => ResPartner._records[id]);
  }

  look(fields) {
    return ResPartner._records[this._id];
  }
}

