ResPartner.search_person = async domain => {
  const ids = Object.keys(ResPartner._records);
  const nids = ids.filter(id => ResPartner._records[id].is_company !== true);
  return new ResPartner(nids);
};

ResPartner.create = async vals => {
  const id = Math.max(...Object.keys(ResPartner._records)) + 1;
  ResPartner._records[id] = { id, ...vals };

  return new ResPartner(id);
};

ResPartner.write = async (id, vals) => {
  const old = ResPartner._records[id];

  ResPartner._records[id] = { ...old, id, ...vals };
  return new ResPartner(id);
};

ResPartner.view = id => {
  return new ResPartner(id);
};

export default ResPartner;
